(15, 'b3cae64c-4c50-4d89-9c4b-3174cb201319', 'Bếp từ đơn Carosel', NULL, '<p><b>* Quận 1&nbsp;</b></p>\r\n\r\n<p>1. Quầy thu ngân tầng trệt, bên trái cửa ra vào Nhà sách Nguyễn Huệ, 40 Nguyễn Huệ, phường Bến Nghé, quận 1, thời gian từ 18h30 - 18h40 ngày 14-5.</p>\r\n\r\n<p>2. Khách sạn Sheraton, 88 Đồng Khởi, quận 1, thời gian từ ngày 13-5.</p>\r\n\r\n<p>3. Starbucks coffee store, tại góc Phạm Hồng Thái và Nguyễn Thị Nghĩa, quận 1, từ 21h đến 21h45 ngày 13-5.</p>\r\n\r\n<p><b>* Quận 3:</b></p>\r\n\r\n<p>1. Công ty Cổ phần tập đoàn Grove, 129 Pasteur, phường Võ Thị Sáu, quận 3, từ ngày 13-5.</p>\r\n\r\n<p>2. Hẻm 287 và 289 Nguyễn Đình Chiểu, phường 5, quận 3, từ ngày 12 đến 20-5.</p>\r\n\r\n<p>3. Hẻm 404 Nguyễn Đình Chiểu, quận 3 từ ngày 13-5.</p>\r\n\r\n<p><b>* Quận 7:</b></p>\r\n\r\n<p>1. Chung cư mini đường số 3, phường Tân Kiểng, quận 7 từ ngày 13-5.</p>\r\n\r\n<p>2. Công ty JAF, 20C4, đường số 66 khu phố 2, phường Tân Phong, quận 7 từ ngày 13-5.</p>\r\n\r\n<p>3. Ngân hàng VIB số 5 -7 Nguyễn Thị Thập, phường Tân Hưng, quận 7 từ ngày 17 đến 27-5.</p>\r\n\r\n<p><b>* Quận 10:</b></p>\r\n\r\n<p>1. Trung tâm y khoa Medic (Bệnh viện Hòa Hảo), quận 10, từ 8h-14h ngày 19-5.</p>\r\n\r\n<p><b>* Quận 12:</b></p>\r\n\r\n<p>1. Tầng 6 tòa nhà Concentrix, Công Viên Phần Mềm Quang Trung, quận 12, từ ngày 13-5.</p>\r\n\r\n<p>2. Block A2 Chung cư Moscow Tower 19 Tân Thới Nhất 17, quận 12, từ ngày 13-5.</p>\r\n\r\n<p>3. Tổ 8, khu phố 3B, Thạch Lộc 19, quận 12, từ ngày 13-5.</p>\r\n\r\n<p>4. Hẻm 178 Bình Quới, tổ 41, khu phố 4, quận 12, từ ngày 13-5.</p>', 'http://localhost:8000/uploads/images/Product/vi-vn-sunhouse-shd6149--(7).jpg', NULL, NULL, NULL, 'bep-tu-don-carosel', NULL, NULL, NULL, NULL, NULL, 'vi', 19, NULL, NULL, '2021-05-28 07:31:19', '2021-06-21 03:20:24'),
