INSERT INTO `samcms_question_product` (`id`, `uuid`, `question`, `answer`, `status`, `created_at`, `updated_at`) VALUES
(2, '87ec0302-a533-4105-9491-747556836497', 'Bạn rảnh không?', '<p>Bộ siêng lắm hay dì trời</p>', 'on', '2021-05-14 03:05:51', '2021-05-14 03:05:51'),
(3, '0e64f44a-de1f-40f3-b970-87a67e6e3c0d', 'Một ngày bạn nhận được bao nhiêu câu hỏi?', '<p>Tui hông có rảnh để trả lời mấy dạng câu hỏi như này nha!</p>', 'on', '2021-05-17 07:05:52', '2021-05-17 07:05:52'),
(4, '43f7807e-fe82-4076-baf8-ca86cc37b4bb', 'Bên bạn hỗ trợ bán trả góp như thế nào?', '<p>Nếu anh mua trả góp sản phẩm thì anh cần đủ điều kiện từ 20 tuổi đến 60 tuổi có CMND (không quá 15 năm kể từ ngày cấp, rõ hình ảnh và thông tin còn rõ ràng), hộ khẩu (có tên người mua trả góp trong hộ khẩu) hoặc bằng lái xe (còn thời hạn) đó ạ.</p>', 'on', '2021-05-17 07:06:26', '2021-05-17 07:06:26'),
(5, 'fdc4496e-c587-41c3-b69e-226caaa800cc', 'Chính sách thu lại bên bạn như thế nào?', '<p>Nếu anh mua sản phẩm mới bên em còn thời gian bảo hành, sản phẩm không đang trả góp và không có lỗi nào thì anh có thể bán lại cho bên em nha anh, anh còn giá trị máy 80% trong tháng đầu tiên nha anh, các tháng tiếp theo trừ thêm 5% anh nhé.</p>', 'on', '2021-05-17 07:06:55', '2021-05-17 07:06:55');
